comment:
현실부정좀 하지마;; 축구선수 연예인 모두 우리와 같은 사람이야
그저 노력을 얼마나 하는지 그 일을 얼마나 즐기는지 자신의 진로를 어떻게 잡았는지에 따라 바뀌는건데 이 모든걸 생각도 안해본 사람들이 맨날 비교하지마라 자존감 낮추지마라 이딴 말이나 하고 다니지
이때까지 살면서 1시간이라도 자신에 대해 어떻게 살지 고민이라도 해본적 있어? 생각없이 남들 다하는 공부따라하다가 주인공처럼 되는거지;;

너그들이 남과 비교 안하고 산다해도 사회는 다 비교해;;
모든 세상살이가 너희 마음대로 되는줄 아나;
불편하면 이겨내던지 회피하려들고있네 루저들;;
